import React, { useState } from "react";
import "./App.css";
import Categories from "./components/categories";
import Headerr from "./components/header";
import Quiz from "./components/quiz"

function App() {
  const [state, setstate] = useState(Quiz);
  return (
    <div className="App">
      <Headerr></Headerr>
      <div className="Cat">
        <Categories name="Coding" >{state}</Categories>
        <Categories name="Entertainment"></Categories>
        <Categories name="Science"></Categories>
        <Categories name="Sports"></Categories>
      </div>
      <p>
        Edit <code>src/App.js</code> and save to reload.
      </p>
      <a
        className="App-link"
        href="https://reactjs.org"
        target="_blank"
        rel="noopener noreferrer"
      >
        Learn React
      </a>
    </div>
  );
}

export default App;
